import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom'; // Correct imports
import CardSearch from './components/CardSearch';
import CardList from './components/CardList';
import CardDetails from './components/CardDetails';
import './App.css';

function App() {
    return (
        <BrowserRouter> {/* Correct usage of Router */}
            <div>
                <Routes> {/* Replace Switch with Routes */}
                    <Route path="/" element={<CardSearch />} /> {/* Correct Route syntax for v6 */}
                    <Route path="/card/:id" element={<CardDetails />} /> {/* Use element prop */}
                </Routes>
            </div>
        </BrowserRouter>
    );
}

export default App;
